/*Table structure for table `meta_busi` */

CREATE TABLE `meta_busi` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `businame` varchar(50) DEFAULT NULL,
  `busicode` varchar(50) DEFAULT NULL,
  `busipath` varchar(50) DEFAULT NULL,
  `metaid` int(11) DEFAULT NULL,
  `version` int(11) DEFAULT NULL,
  `isapp` varchar(10) DEFAULT 'pc',
  `createtime` datetime DEFAULT NULL,
  `remark` varchar(2000) DEFAULT NULL,
  `tenantId` int(11) DEFAULT NULL,
  `enable` char(1) DEFAULT NULL,
  `fileBlob` mediumblob COMMENT '对应html/jsp/js模版源文件',
  `year` varchar(10) DEFAULT NULL COMMENT '年度',
  `userId` varchar(50) DEFAULT NULL COMMENT '创建人id',
  `userName` varchar(100) DEFAULT NULL COMMENT '创建人名称',
  `flowid` varchar(100) DEFAULT NULL COMMENT '绑定流程id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=62 DEFAULT CHARSET=utf8;

/*Data for the table `meta_busi` */

insert  into `meta_busi`(`id`,`businame`,`busicode`,`busipath`,`metaid`,`version`,`isapp`,`createtime`,`remark`,`tenantId`,`enable`,`fileBlob`,`year`,`userId`,`userName`,`flowid`) values (53,'请假单模板','001','',32,1,'pc','2015-11-24 17:44:09','请假单模板',611,'0','<!DOCTYPE html>\r\n<html lang=\"en\">\r\n<head>\r\n<meta charset=\"UTF-8\">\r\n<title>请假申请表</title>\r\n<style>\r\n	body{\r\n		text-align: center;\r\n	}\r\n	.main{\r\n		width: 750px;\r\n		border: 2px #000 solid;\r\n		border-collapse: collapse;\r\n		font-size: 14px;\r\n		font-family: \"微软雅黑\";\r\n		text-align: center;\r\n		margin: 0 auto;\r\n	}\r\n	input{\r\n		border: none;\r\n		font-size: 14px;\r\n		outline: none;\r\n		text-align: center;\r\n		font-family: \"微软雅黑\";\r\n	}\r\n	.main td{\r\n		border: 1px #000 solid;\r\n		height: 40px;\r\n		width: 16%;\r\n\r\n	}\r\n	.main tr{\r\n		width: 100%;\r\n	}\r\n	/* .main td input,.main td label{\r\n		float: left;\r\n		margin-left: 10px;\r\n		margin-top: 10px;\r\n	} */\r\n	.font0{\r\n		font-size: 0;\r\n	}\r\n	.font0 input,.font0 label{\r\n		font-size: 14px;\r\n		margin-right: 10px;\r\n		vertical-align: middle;\r\n	}\r\n	.leavedate input{\r\n		width: 35px;\r\n		border: none;\r\n		border-bottom: 1px solid #000;\r\n		outline: none;\r\n		text-align: right;\r\n	}\r\n	input[type=checkbox]{\r\n		margin-top: -4px;\r\n	}\r\n	#otherreason{\r\n		width: 40px;\r\n		border: none;\r\n		border-bottom: 1px solid #000;\r\n		outline: none;\r\n		text-align: left;\r\n	}\r\n	.leavetxt{\r\n		width:95%;\r\n		height:90%;\r\n		resize:none;\r\n		border:none;\r\n		outline:none;\r\n		font-family: \"微软雅黑\";\r\n		font-size:14px;\r\n	}\r\n</style>\r\n\r\n<link rel=\"stylesheet\" href=\"static/bootstrap.min.css\">\r\n<link rel=\"stylesheet\" href=\"static/sheet/bootstrap-datetimepicker-master/css/bootstrap-datetimepicker.min.css\">\r\n\r\n<script type=\"text/javascript\" src=\"static/jquery-2.1.4.min.js\"></script>\r\n<script type=\"text/javascript\" src=\"static/sheet/bootstrap-datetimepicker-master/js/bootstrap-datetimepicker.js\"></script>\r\n<script type=\"text/javascript\" src=\"static/sheet/bootstrap-datetimepicker-master/js/locales/bootstrap-datetimepicker.zh-CN.js\"></script>\r\n<script type=\"text/javascript\">\r\n	var ctx = \"http://192.168.2.11:8080/appdo-web-flow\";\r\n</script>\r\n<script type=\"text/javascript\" src=\"static/js/flow_js/flow_base_js/LeaveRequest.js\"></script>\r\n<script type=\"text/javascript\" src=\"static/js/easyui/jquery.easyui.min.js\"></script>\r\n\r\n</head>\r\n<body>\r\n	<h2>请假申请表</h2>\r\n	<table width=\"659\" border=\"0\">\r\n  <tr>\r\n    <td width=\"521\"><div align=\"right\">编号：</div></td>\r\n	<td>\r\n	<input  name=\"billNo\" type=\"text\" title=\"填表日期\" value=\"\" qplugins=\"text\" orghide=\"0\" orgalign=\"left\" orgwidth=\"150\" data-options=\"validType:&#39;length&#39;\" class=\"easyui-validatebox\" readonly=\"readonly\" style=\"width:97%\">\r\n	</td>\r\n  </tr>\r\n</table>\r\n\r\n	<table class=\"main\">\r\n		<tr>\r\n			<td>填表日期</td>\r\n			<td><input  name=\"input_date\" type=\"text\" title=\"填表日期\" value=\"\" qplugins=\"text\" orghide=\"0\" orgalign=\"left\" orgwidth=\"150\" data-options=\"validType:&#39;length&#39;\" class=\"easyui-validatebox\" readonly=\"readonly\" style=\"width:97%\"></td>\r\n			<td style=\"width:18%\">部门</td>\r\n			<td><textarea name=\"dept\" readonly=\"readonly\" class=\"easyui-validatebox\" style=\"width:97%\" title=\"部门\" qplugins=\"text\" orghide=\"0\" orgalign=\"left\" orgwidth=\"150\" data-options=\"validType:\'length\'\"></textarea></td>\r\n			<td>申请人</td>\r\n			<td><input name=\"user_info\" type=\"text\" title=\"申请人\" value=\"\" qplugins=\"text\" readonly=\"readonly\" orghide=\"0\" orgalign=\"left\" orgwidth=\"150\" data-options=\"validType:&#39;length&#39;\" class=\"easyui-validatebox\" style=\"width:97%\"></td>\r\n		</tr>\r\n		<tr>\r\n			<td>请假日期</td>\r\n			<td colspan=\"5\" class=\"leavedate\">\r\n				<input id=\"begin_date\" type=\"text\" readonly=\"readonly\" placeholder=\"年/月/日/时\" style=\"