DROP TABLE IF EXISTS `v_bpm_todo`;

/*!50001 CREATE TABLE  `v_bpm_todo`(
 `id` int(11) ,
 `title` varchar(50) ,
 `code` varchar(50) ,
 `instanceid` varchar(50) ,
 `name` varchar(50) ,
 `metaid` varchar(50) ,
